import React from 'react';
import Header from './Components/Header';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
        <Header />

        <Switch>
            <Route><h2>Beaches near you</h2> </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
